import logo from './logo.svg';
import './App.css';
import Router from './routes/Route';
import { Routes, Route, useLocation } from 'react-router-dom';
import Login from './pages/auth/Login';

function App() {
  return (
    <Routes>
    <Route path="/" element={
      <Login></Login>
    } />
    </Routes>
  );
}

export default App;
